class Glyph:
    def __init__(self, char, name, width, descent, ascent, left_bearing, right_bearing):
        self.char = char
        self.name = name
        self.width = width
        self.descent = descent
        self.ascent = ascent
        self.left_bearing = left_bearing
        self.right_bearing = right_bearing

GLYPHS = {}

class FontMetrics:
    def __init__(self):
        self.glyphCount = 0
        self.baseline = 0
        self.capsHeight = 0
        self.xHeight = 0
        self.height = 0
        self.glyphs = {}

    def get_glyph(self, char: str) -> Glyph:
        if char is not None and len(char) > 0:
            c = char[0]
            code = ord(c)
            if code in GLYPHS:
                return GLYPHS[code]
        return GLYPHS[77]  # char 'M'


